    [],nt"num_tags": 3,nt"name": "sand-lake-wetland-management-district-annual-narrative-report-calendar-year-1981",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Sand Lake
    WMD outlines Refuge accomplishments during the 1981 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses compliance with
    environmental and cultural resource mandates. Refuge administration is outlined;
    information about personnel, funding, and safety is given. Habitat management is
    also covered; subjects include wetlands, forests, croplands, grasslands, grazing,
    haying, pest control, and WPA easements. The wildlife section of the report discusses
    endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
    raptors, game mammals, fisheries resources, and wildlife propagation. The public
    uses of the Refuge described in this report include outdoor classrooms, hunting,
    fishing, trapping, wildlife observation, and law enforcement. The equipment and
    facilities section of the report provides information about new construction and
    major maintenance. Items of interest are provided at the end.",nt"owner_org":
